function GetDay(ts) {

    let currentServerTime  = Math.floor(Date.now() / 1000);
    let projectStartTime   = 1610323200;
    let DAY_SECONDS        = 86400;
    let CYCLE_LENGTH_SECS  = 14 * DAY_SECONDS;   // 14-day Battlefield cycle

    // 1) Find the start time of the current Battlefield cycle
    let cyclesSinceProjectStart = Math.floor((ts - projectStartTime) / CYCLE_LENGTH_SECS);

    let battleFieldCycleStartTime = projectStartTime + cyclesSinceProjectStart * CYCLE_LENGTH_SECS;

    // 2) Seconds since that cycle started
    let elapsedSeconds = currentServerTime - battleFieldCycleStartTime;

    // 3) Convert to 1-based day index
    let openDay = Math.floor(elapsedSeconds / DAY_SECONDS) + 1;

    return openDay;
}

