function setScale(n) {
  scale += n;
  dayW = 1 * scale;
  document.querySelectorAll('.gen-day-header-item, .state-head-day').forEach(el => {
    el.style.width = dayW + "pt";
  });
  document.querySelectorAll('.state-head-gen-item').forEach(el => {
    el.style.width = parseInt(el.getAttribute('days')) * dayW + "pt";
  });
  document.querySelectorAll('.state-wrapper').forEach(el => {
    el.style.marginLeft = (parseInt(el.getAttribute('startDay')) - 1) * scale + "pt";
  });
  
}

function setTodayLine() {
  let genContainer = document.querySelector('.gen-container');
  let genContainerRect = genContainer.getBoundingClientRect();
  let line = document.querySelector('.gen-today-line');
  //line.style.top = genContainerRect.y + "px";
  line.style.left = nowDay * dayW + "pt";
  line.style.width = dayW + "pt";
  line.style.height = genContainer.scrollHeight + "px";
  genContainer.scrollLeft = line.offsetLeft - (genContainerRect.width / 2);
}

let pinnedItemCount = 0;
let pinnedItemHeight = 0;
let pinnedTopHeight = 0;
function updatePinnedItems() {
  let genBody = document.querySelector('.gen-body');
  let genHeader = document.querySelector('.gen-header');
  let genHeaderRect = genHeader.getBoundingClientRect();
  pinnedTopHeight = genHeaderRect.height;
  pinnedItemCount = 0;
  document.querySelectorAll('.state-wrapper.pinned').forEach((item, idx) => {
    pinnedItemCount += 1;
    if (idx == 0) {
      pinnedItemHeight = 0;
    }
    let itemRect = item.getBoundingClientRect();
    let itemHeight = itemRect.height;
    pinnedItemHeight += itemHeight;
    let itemTopHeight = (pinnedTopHeight + pinnedItemHeight) - itemHeight;
    item.style.position = "sticky";
    item.style.top = itemTopHeight + "px";
    item.style.zIndex = ((idx + 1) * 100) + "";
  });
  
}
function PinItem(item) {
  let is_pinned = item.classList.contains('pinned');
  if (is_pinned) {
    item.classList.remove('pinned')
    item.style.position = "";
    item.style.top = "";
    item.style.zIndex = "";
  } else {
    item.classList.add('pinned')
  }
  updatePinnedItems();
}


