function GetStateItemHead(stateAge) {
  let stateItemHead = document.createElement('div');
  let containerDays = document.createElement('div');
  let containerItems = document.createElement('div');
  stateItemHead.classList.add('state-head');
  containerDays.classList.add('state-head-days');
  containerItems.classList.add('state-head-gen-items');
  
  for (let i=1; i<=1037+84; i++) {
    let dayItem = document.createElement('div');
      dayItem.textContent = "" + i;
      dayItem.classList.add('state-head-day')
      dayItem.style.width = dayW + "pt";
      dayItem.style.borderWidth = 0.1 + "pt";
      containerDays.appendChild(dayItem)
  }
  
  for (let i=1; i <= Object.keys(gen_data).length; i++) {
    let day_start = gen_data[i].day;
    let day_end = gen_data[i+1] ? gen_data[i+1].day : day_start + 84;
    let days = day_end - day_start;
    let heros = gen_data[i].heros;

    let genItem = document.createElement('div');
    let genItemSpan = document.createElement('span');
    genItemSpan.textContent = "S" + i;
    genItem.appendChild(genItemSpan);
    genItem.classList.add('state-head-gen-item')
    genItem.setAttribute('days', days)
    genItem.style.width = days * dayW + "pt";
    containerItems.appendChild(genItem)
  }
  stateItemHead.appendChild(containerDays);
  stateItemHead.appendChild(containerItems);
  return stateItemHead;
}

function GetStateItemBody(stateNum) {
  let stateItemBody = document.createElement('div');
  stateItemBody.classList.add('state-body');
  let stateItemBodySpan = document.createElement('span');
  stateItemBodySpan.textContent = "State " + stateNum;
  stateItemBody.appendChild(stateItemBodySpan);
  return stateItemBody;
}

function GetStateItemContent(stateNum, startDay, stateAge) {
  let stateItemContent = document.createElement('div');
  stateItemContent.addEventListener('pointerup', (e) => {
    if (e.pointerType === 'mouse' && e.button !== 0) return;
    PinItem(stateItemContent);
  });
  stateItemContent.classList.add('state-wrapper');
  stateItemContent.setAttribute('startDay', startDay - 1)
  stateItemContent.style.marginLeft = (startDay - 1) * scale + "pt";
  let stateHead = GetStateItemHead(stateAge);
  let stateBody = GetStateItemBody(stateNum);
  stateItemContent.appendChild(stateHead);
  stateItemContent.appendChild(stateBody);
  return stateItemContent;
}

function showStates(states) {
  //document.querySelectorAll('.gen-body > *').forEach(e=>e.remove())
  pinnedItemCount = 0;
  pinnedItemHeight = 0;
  pinnedTopHeight = 0;
  for (let el of document.querySelectorAll('.gen-body > *')) {
    el.remove();
  }
  for (let stateNum of states) {
    let state = state_data_map[stateNum];
    if (state) {
      let stateNum = state.state
      let startDay = state.startDay;
      let stateAge = state.stateAgeDays;
      let stateItem = GetStateItemContent(stateNum, startDay, stateAge);
      stateItem.style.visibility = "hidden";
      containerBody.appendChild(stateItem);
    }
  }
  setTodayLine();
}


let filterBtn = document.querySelector('#stateFilterBtn');
let filterInput = document.querySelector('#stateFilterInput');

function showStatesFromValue(value) {
  let show = [];
  for (let item of value.split(',')) {
    if (item.match('-')) {
      let [startRange, endRange] = item.split('-');
      for (let i=parseInt(startRange); i<=parseInt(endRange); i++) {
        show.push(i);
      }
    } else {
      show.push(parseInt(item));
    }
  };
  show.sort((a,b) => a - b);
  showStates(show);
}

document.querySelector('#stateFilterBtn').addEventListener('pointerup', (e) => {
  if (e.pointerType === 'mouse' && e.button !== 0) return;
  let inputText = filterInput.value;
  showStatesFromValue(inputText);
})

showStatesFromValue('1-50');


function isInContainerView(elm, container, partial = true) {
  const rect = elm.getBoundingClientRect();
  const containerRect = container.getBoundingClientRect();

  if (partial) {
    // Any intersection between rect and containerRect
    const verticallyVisible =
      rect.bottom > containerRect.top && rect.top < containerRect.bottom;
    const horizontallyVisible =
      rect.right > containerRect.left && rect.left < containerRect.right;

    return verticallyVisible && horizontallyVisible;
  } else {
    // Fully inside the container
    const verticallyVisible =
      rect.top >= containerRect.top && rect.bottom <= containerRect.bottom;
    const horizontallyVisible =
      rect.left >= containerRect.left && rect.right <= containerRect.right;

    return verticallyVisible && horizontallyVisible;
  }
}

